var s_a = new Array();

function findPlateIndex(id) {
    for (var i = 0; i < country_arr.length; i++) {
        if (country_arr[i][0] == id) {
            return i;
        }
    }
}

for (var i = 0; i < dbObject.length; i++) {
    var currentCountry = dbObject[i];
    var countryIndex = findPlateIndex(currentCountry.Il);
    if (s_a[countryIndex] == undefined) {
        s_a[countryIndex] = new Array();
    }
    s_a[countryIndex].push(new Array(
        currentCountry.ID, currentCountry.Ilce)
    );
}

function populateStates(countryElementId, stateElementId, chooseWord = 'Seçiniz') {

    var selectedCountryIndex = document.getElementById(countryElementId).selectedIndex;

    var stateElement = document.getElementById(stateElementId);

    stateElement.length = 0;	
    stateElement.options[0] = new Option(chooseWord, '');
    stateElement.options[0].disabled = true;
    stateElement.selectedIndex = 0;

    var state_arr = s_a[selectedCountryIndex - 1];

    for (var i = 0; i < state_arr.length; i++) {
        stateElement.options[stateElement.length] = new Option(state_arr[i][1], state_arr[i][0]);
    }
}

function populateCountries(countryElementId, stateElementId, chooseWordProvince, chooseWordDitrict = 'Seçiniz') {
    var countryElement = document.getElementById(countryElementId);
    countryElement.length = 0;
    countryElement.options[0] = new Option(chooseWordProvince, '');
    countryElement.options[0].disabled = true;
    countryElement.selectedIndex = 0;


    for (var i = 0; i < country_arr.length; i++) {

        countryElement.options[countryElement.length] = new Option(country_arr[i][1], country_arr[i][0]);

    }

    if (stateElementId) {
        countryElement.onchange = function () {
            populateStates(countryElementId, stateElementId, chooseWordDitrict);
        };

    }
}

window.onload = function () {
    populateCountries('turkey-provinces-individual', 'turkey-district-individual', 'İl', 'İlce');
};

function populateCountries(countryElementId, stateElementId, chooseWordProvince, chooseWordDistrict) {
    var countryElement = document.getElementById(countryElementId);
    countryElement.length = 0;
    countryElement.options[0] = new Option(chooseWordProvince, '');
    countryElement.options[0].disabled = true;
    countryElement.selectedIndex = 0;

    for (var i = 0; i < country_arr.length; i++) {
        countryElement.options[countryElement.length] = new Option(country_arr[i][1], country_arr[i][0]);
    }

    if (stateElementId) {
        countryElement.onchange = function () {
            populateStates(countryElementId, stateElementId, chooseWordDistrict);
        };
    }
}

function populateStates(countryElementId, stateElementId, chooseWordDistrict) {
    var selectedCountryIndex = document.getElementById(countryElementId).selectedIndex;
    var stateElement = document.getElementById(stateElementId);

    stateElement.length = 0; 
    stateElement.options[0] = new Option(chooseWordDistrict, '');
    stateElement.options[0].disabled = true;
    stateElement.selectedIndex = 0;

    var state_arr = s_a[selectedCountryIndex - 1];

    for (var i = 0; i < state_arr.length; i++) {
        stateElement.options[stateElement.length] = new Option(state_arr[i][1], state_arr[i][0]);
    }
}

function populateHospitals(provinceId) {
    var hospitalSelect = document.getElementById('hastane');
    hospitalSelect.innerHTML = ''; 

    var defaultOption = document.createElement('option');
    defaultOption.value = '';
    defaultOption.textContent = '-FARK ETMEZ-';
    hospitalSelect.appendChild(defaultOption);

    if (hospitals[provinceId]) {
        var provinceHospitals = hospitals[provinceId];

        provinceHospitals.forEach(function (hospital) {
            var option = document.createElement('option');
            option.value = hospital.id;
            option.textContent = hospital.name;
            hospitalSelect.appendChild(option);
        });
    }
}

document.getElementById('turkey-provinces-individual').addEventListener('change', function () {
    var selectedProvinceId = parseInt(this.value);
    populateHospitals(selectedProvinceId);
});


function populateDoctors(provinceId) {
    var doctorSelect = document.getElementById('hekim');
    doctorSelect.innerHTML = ''; 

    var defaultOption = document.createElement('option');
    defaultOption.value = '';
    defaultOption.textContent = '-FARK ETMEZ-';
    doctorSelect.appendChild(defaultOption);

    if (doctors[provinceId]) {
        var provinceDoctors = doctors[provinceId];

        provinceDoctors.forEach(function (doctor) {
            var option = document.createElement('option');
            option.value = doctor.id;
            option.textContent = doctor.name;
            doctorSelect.appendChild(option);
        });
    }
}

document.getElementById('turkey-provinces-individual').addEventListener('change', function () {
    var selectedProvinceId = parseInt(this.value);
    populateDoctors(selectedProvinceId);
});






